import React from 'react';
import {Button, Container} from "react-bootstrap";
import CreateColor from "../components/modals/CreateColor";
import CreateProduct from "../components/modals/CreateProduct";
import CreateType from "../components/modals/CreateType";

const Admin = () => {
    return (
        <Container style={{display: 'flex', flexDirection: 'column', marginTop: 100, gap: 20}}>
            <Button style={{cursor: 'pointer', width: 200, height: 30, borderRadius: 18, background: 'transparent', marginLeft: 50}}>Добавить тип</Button>
            <Button style={{cursor: 'pointer', width: 200, height: 30, borderRadius: 18, background: 'transparent', marginLeft: 50}}>Добаавить цвет</Button>
            <Button style={{cursor: 'pointer', width: 200, height: 30, borderRadius: 18, background: 'transparent', marginLeft: 50}}>Добавить продукт</Button>
            <CreateColor />
            <CreateProduct />
            <CreateType show={true} />
        </Container>
    );
};

export default Admin;
